/// Return median of elements in the vector l.
/// >>> median(vec![3, 1, 2, 4, 5])
/// 3.0
/// >>> median(vec![-10, 4, 6, 1000, 10, 20])
/// 15.0
fn median(l: Vec<isize>) -> f64 {
    if l.is_empty() {
        return 0.0;
    }

    let mut sorted_l = l.clone();
    sorted_l.sort_unstable();

    let len = sorted_l.len();
    let mid = len / 2;

    if len % 2 == 0 {
        (sorted_l[mid - 1] as f64 + sorted_l[mid] as f64) / 2.0
    } else {
        sorted_l[mid] as f64
    }
}

