fn check_if_last_char_is_a_letter(txt: String) -> bool {
    if txt.is_empty() {
        return false;
    }

    let last_char = txt.chars().last().unwrap();
    let second_last_char = txt.chars().rev().skip(1).next();

    if last_char.is_alphabetic() && (second_last_char.is_none() || second_last_char.unwrap().is_whitespace()) {
        return true;
    }

    false
}

