fn double_the_difference(lst: Vec<f64>) -> isize {
    let mut sum = 0;
    for num in lst {
        if num > 0.0 && num.fract() == 0.0 {
            let int_num = num as isize;
            if int_num % 2 != 0 {
                sum += int_num * int_num;
            }
        }
    }
    sum
}

