/// Your task is to implement a function that will simplify the expression
/// x * n. The function returns true if x * n evaluates to a whole number and false
/// otherwise. Both x and n, are string representation of a fraction, and have the following format,
/// <numerator>/<denominator> where both numerator and denominator are positive whole numbers.
/// You can assume that x, and n are valid fractions, and do not have zero as denominator.
/// >>> simplify(String::from("1/5"), String::from("5/1"))
/// true
/// >>> simplify(String::from("1/6"), String::from("2/1"))
/// false
/// >>> simplify(String::from("7/10"), String::from("10/2"))
/// false
fn simplify(x: String, n: String) -> bool {
    let x_parts: Vec<&str> = x.split('/').collect();
    let n_parts: Vec<&str> = n.split('/').collect();

    let x_numerator = x_parts[0].parse::<i32>().unwrap();
    let x_denominator = x_parts[1].parse::<i32>().unwrap();
    let n_numerator = n_parts[0].parse::<i32>().unwrap();
    let n_denominator = n_parts[1].parse::<i32>().unwrap();

    let result_numerator = x_numerator * n_numerator;
    let result_denominator = x_denominator * n_denominator;

    fn gcd(a: i32, b: i32) -> i32 {
        if b == 0 {
            a
        } else {
            gcd(b, a % b)
        }
    }

    let gcd_result = gcd(result_numerator, result_denominator);
    let simplified_denominator = result_denominator / gcd_result;

    simplified_denominator == 1
}

