/// You are given a rectangular grid of wells. Each row represents a single well,
/// and each 1 in a row represents a single unit of water.
/// Each well has a corresponding bucket that can be used to extract water from it, 
/// and all buckets have the same capacity.
/// Your task is to use the buckets to empty the wells.
/// Output the number of times you need to lower the buckets.
/// Example 1:
/// >>> max_fill(vec![vec![0, 0, 1, 0], vec![0, 1, 0, 0], vec![1, 1, 1, 1]], 1)
/// 6
/// Example 2:
/// >>> max_fill(vec![vec![0, 0, 1, 1], vec![0, 0, 0, 0], vec![1, 1, 1, 1], vec![0, 1, 1, 1]], 2)
/// 5
/// Example 3:
/// >>> max_fill(vec![vec![0, 0, 0], vec![0, 0, 0]], 5)
/// 0
/// Constraints:
/// * all wells have the same length
/// * 1 <= grid.length <= 10^2
/// * 1 <= grid[:,1].length <= 10^2
/// * grid[i][j] -> 0 | 1
/// * 1 <= capacity <= 10
fn max_fill(grid: Vec<Vec<isize>>, capacity: isize) -> isize {
    let mut total_water = 0;
    let mut max_fill_count = 0;

    for row in &grid {
        total_water += row.iter().filter(|&&x| x == 1).count();
    }

    if total_water == 0 {
        return 0;
    }

    while total_water > 0 {
        let mut current_capacity = capacity;
        for row in &grid {
            for (index, &value) in row.iter().enumerate() {
                if value == 1 && current_capacity > 0 {
                    current_capacity -= 1;
                    total_water -= 1;
                }
            }
        }
        max_fill_count += 1;
    }

    max_fill_count
}

