/// Write a function that takes a message, and encodes in such a 
/// way that it swaps case of all letters, replaces all vowels in 
/// the message with the letter that appears 2 places ahead of that 
/// vowel in the english alphabet. 
/// Assume only letters. 
/// Examples:
/// >>> encode(String::from("test"))
/// String::from("TGST")
/// >>> encode(String::from("This is a message"))
/// String::from("tHKS KS C MGSSCGG")
fn encode(message: String) -> String {
    let vowels = "aeiouAEIOU";
    let mut encoded = String::new();

    for c in message.chars() {
        if c.is_alphabetic() {
            let is_vowel = vowels.contains(c);

            let mut new_char = if c.is_lowercase() {
                c.to_ascii_uppercase()
            } else {
                c.to_ascii_lowercase()
            };

            if is_vowel {
                let offset = if c.is_lowercase() { 'a' } else { 'A' };
                new_char = (((c as u8 - offset as u8) + 2) % 26 + offset as u8) as char;
                new_char = if new_char.is_lowercase() {
                    new_char.to_ascii_uppercase()
                } else {
                    new_char.to_ascii_lowercase()
                };
            }

            encoded.push(new_char);
        } else {
            encoded.push(c);
        }
    }

    encoded
}

