/// 30 = 2 * 3 * 5
fn is_multiply_prime(a: isize) -> bool {
    if a < 2 {
        return false;
    }

    let mut prime_factors = Vec::new();

    for i in 2..a {
        if a % i == 0 && is_prime(i) {
            prime_factors.push(i);
        }
    }

    if prime_factors.len() == 3 {
        let product = prime_factors[0] * prime_factors[1] * prime_factors[2];
