fn prod_signs(arr: Vec<isize>) -> Option<isize> {
    if arr.is_empty() {
        return None;
    }

    let mut result = 0;

    for num in arr {
        if num == 0 {
            return Some(0);
        }
        result += num;
    }

    Some(result)
}

