/// Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
/// separate those group into separate strings and return the vector of those.
/// Separate groups are balanced (each open brace is properly closed) and not nested within each other
/// Ignore any spaces in the input string.
/// >>> separate_paren_groups(String::from("( ) (( )) (( )( ))"))
/// vec![String::from("()"), String::from("(())"), String::from("(()())")]
fn separate_paren_groups(paren_string: String) -> Vec<String> {
    let mut result = Vec::new();
    let mut stack = Vec::new();
    let mut current_group = String::new();

    for ch in paren_string.chars() {
        if ch == ' ' {
            continue;
        }

        if ch == '(' {
            stack.push(ch);
            current_group.push(ch);
        } else if ch == ')' {
            if let Some(last) = stack.pop() {
                if last == '(' {
                    current_group.push(ch);
                    if stack.is_empty() {
                        result.push(current_group.clone());
                        current_group.clear();
                    }
                } else {
                    panic!("Invalid input string");
                }
            } else {
                panic!("Invalid input string");
            }
        } else {
            panic!("Invalid input string");
        }
    }

    if !stack.is_empty() {
        panic!("Invalid input string");
    }

    result
}

