/// vec![1, 2, 3]
/// >>> sort_even(vec![5, 6, 3, 4])
/// vec![3, 6, 5, 4]
fn sort_even(l: Vec<isize>) -> Vec<isize> {
    let mut even_values: Vec<isize> = l.iter().enumerate().filter_map(|(i, &v)| if i % 2 == 0 { Some(v) } else { None }).collect();
