/// Create a function encrypt that takes a string as an argument and
/// returns a string encrypted with the alphabet being rotated. 
/// The alphabet should be rotated in a manner such that the letters 
/// shift down by two multiplied to two places.
/// For example:
/// >>> encrypt(String::from("hi"))
/// String::from("lm")
/// >>> encrypt(String::from("asdfghjkl"))
/// String::from("ewhjklnop")
/// >>> encrypt(String::from("gf"))
/// String::from("kj")
/// >>> encrypt(String::from("et"))
/// String::from("ix")
fn encrypt(s: String) -> String {
    let mut encrypted = String::new();
    for c in s.chars() {
        let offset = if c.is_ascii_lowercase() { 97 } else { 65 };
        if c.is_ascii_alphabetic() {
            let position = (c as u8 - offset) as usize;
            let shift = 2 * 2;
            let new_char = ((position + shift) % 26) as u8 + offset;
            encrypted.push(new_char as char);
        } else {
            encrypted.push(c);
        }
    }
    encrypted
}

