fn order_by_points(nums: Vec<isize>) -> Vec<isize> {
    let mut mapped_nums: Vec<(usize, isize, isize)> = nums
        .into_iter()
        .enumerate()
        .map(|(i, num)| {
            let sum = num
                .abs()
                .to_string()
                .chars()
                .filter(|c| c.is_digit(10))
                .map(|c| c.to_digit(10).unwrap() as isize)
                .sum::<isize>();
            (i, num, sum)
        })
        .collect();

