/// String::from("string")
/// >>> find_max(vec![String::from("name"), String::from("enam"), String::from("game")])
/// String::from("enam")
/// >>> find_max(vec![String::from("aaaaaaa"), String::from("bb"), String::from("cc")])
/// String::from("aaaaaaa")
fn find_max(words: Vec<String>) -> String {
    let mut max_unique_chars = 0;
    let mut result = String::new();

    for word in words {
        let unique_chars = word.chars().collect::<std::collections::HashSet<char>>().len();
        if unique_chars > max_unique_chars {
            max_unique_chars = unique_chars;
            result = word.clone();
        } else if unique_chars == max_unique_chars && word < result {
            result = word.clone();
        }
    }

    result
}

