/// positive integers that start or end with 1.
fn starts_one_ends(n: isize) -> isize {
    if n <= 0 {
        return 0;
    }

    if n == 1 {
        return 2;
    }

    let start_with_one = 10isize.pow((n - 1) as u32) - 1;
    let end_with_one = 10isize.pow((n - 1) as u32) - 1;

    let overlap = 10isize.pow((n - 2) as u32) - 1;

    start_with_one + end_with_one - overlap
}

