/// >>> count_nums(vec![-1, 11, -11])
/// 1
/// >>> count_nums(vec![1, 1, 2])
/// 3
fn count_nums(arr: Vec<isize>) -> isize {
    let mut count = 0;

    for num in arr {
        let mut sum = 0;
        let mut n = num;

        while n != 0 {
            sum += n % 10;
            n /= 10;
        }

        if sum > 0 {
            count += 1;
        }
    }

    count
}

