fn get_closest_vowel(word: String) -> String {
    let vowels = "AEIOUaeiou";
    let mut closest_vowel = String::new();

    for i in 1..word.len() - 1 {
        let c = word.chars().nth(i).unwrap();
        let prev = word.chars().nth(i - 1).unwrap();
        let next = word.chars().nth(i + 1).unwrap();

        if vowels.contains(c) && !vowels.contains(prev) && !vowels.contains(next) {
            closest_vowel = c.to_string();
            break;
        }
    }

    closest_vowel
}

