/// prime_fib returns n-th number that is a Fibonacci number and it's also prime.
/// >>> prime_fib(1)
/// 2
/// >>> prime_fib(2)
/// 3
/// >>> prime_fib(3)
/// 5
/// >>> prime_fib(4)
/// 13
/// >>> prime_fib(5)
/// 89
fn prime_fib(n: isize) -> isize {
    fn is_prime(num: isize) -> bool {
        if num <= 1 {
            return false;
        }
        for i in 2..=((num as f64).sqrt() as isize) {
            if num % i == 0 {
                return false;
            }
        }
        true
    }

    fn fib(num: isize) -> isize {
        let mut a = 0;
        let mut b = 1;
        for _ in 0..num {
            let temp = a;
            a = b;
            b = temp + b;
        }
        a
    }

    let mut count = 0;
    let mut i = 1;
    while count < n {
        let fib_num = fib(i);
        if is_prime(fib_num) {
            count += 1;
        }
        i += 1;
    }
    fib(i - 1)
}

