/// Given a positive integer n, return the product of the odd digits.
/// Return 0 if all digits are even.
/// For example:
/// >>> digits(1)
/// 1
/// >>> digits(4)
/// 0
/// >>> digits(235)
/// 15
fn digits(n: isize) -> isize {
    let mut product = 1;
    let mut all_even = true;
    let mut num = n;

    while num > 0 {
        let digit = num % 10;
        if digit % 2 != 0 {
            product *= digit;
            all_even = false;
        }
        num /= 10;
    }

    if all_even {
        return 0;
    } else {
        return product;
    }
}

