/// and return the result as a string.
/// If shift > number of digits, return digits reversed.
/// >>> circular_shift(12, 1)
/// String::from("21")
/// >>> circular_shift(12, 2)
/// String::from("12")
fn circular_shift(x: isize, shift: isize) -> String {
    let x_str = x.to_string();
    let num_digits = x_str.len();
    let shift = if shift as usize > num_digits { num_digits } else { shift as usize };

    let (left, right) = x_str.split_at(num_digits - shift);
    let result = format!("{}{}", right, left);

    result
}

