/// Return true is vector elements are monotonically increasing or decreasing.
/// >>> monotonic(vec![1, 2, 4, 20])
/// true
/// >>> monotonic(vec![1, 20, 4, 10])
/// false
/// >>> monotonic(vec![4, 1, 0, -10])
/// true
fn monotonic(l: Vec<isize>) -> bool {
    if l.len() < 2 {
        return true;
    }

    let mut increasing = None;

    for i in 1..l.len() {
        let diff = l[i] - l[i - 1];
        if diff == 0 {
            continue;
        }

        if let Some(is_increasing) = increasing {
            if (is_increasing && diff < 0) || (!is_increasing && diff > 0) {
                return false;
            }
        } else {
            increasing = Some(diff > 0);
        }
    }

    true
}

