/// Given a string text, replace all spaces in it with underscores, 
/// and if a string has more than 2 consecutive spaces, 
/// then replace all consecutive spaces with - 
/// >>> fix_spaces(String::from(" Example"))
/// String::from("Example")
/// >>> fix_spaces(String::from(" Example 1"))
/// String::from("Example_1")
/// >>> fix_spaces(String::from(" Example 2"))
/// String::from("_Example_2")
/// >>> fix_spaces(String::from(" Example 3"))
/// String::from("_Example-3")
fn fix_spaces(text: String) -> String {
    let mut result = String::new();
    let mut space_count = 0;
    let mut start_of_string = true;

    for c in text.chars() {
        if c == ' ' {
            space_count += 1;
            if space_count == 1 {
                if !start_of_string {
                    result.push('_');
                }
            } else if space_count > 1 {
                if start_of_string {
                    if space_count == 2 {
                        result.push('_');
                    } else if space_count >= 3 {
                        result.pop();
                        result.push('-');
                    }
                } else {
                    result.pop();
                    result.push('-');
                }
            }
        } else {
            start_of_string = false;
            space_count = 0;
            result.push(c);
        }
    }

    result
}

