/// >>> anti_shuffle(String::from("hello"))
/// String::from("ehllo")
/// >>> anti_shuffle(String::from("Hello World!!!"))
/// String::from("Hello !!!Wdlor")
fn anti_shuffle(s: String) -> String {
    let mut result = String::new();
    let words = s.split(' ');

    for (i, word) in words.enumerate() {
        let mut chars: Vec<char> = word.chars().collect();
        chars.sort_unstable_by(|a, b| a.to_ascii_lowercase().cmp(&b.to_ascii_lowercase()));

        let sorted_word: String = chars.into_iter().collect();
        if i > 0 {
            result.push(' ');
        }
        result.push_str(&sorted_word);
    }

    result
}

