/// vec![0, 1, 2, 3, 4, 5]
/// >>> sort_array(vec![2, 4, 3, 0, 1, 5, 6])
/// vec![6, 5, 4, 3, 2, 1, 0]
fn sort_array(array: Vec<isize>) -> Vec<isize> {
    let mut sorted_array = array.clone();
    if array.is_empty() {
        return sorted_array;
    }

    let first_value = array[0];
    let last_value = array[array.len() - 1];
    let sum = first_value + last_value;

    if sum % 2 == 1 {
        sorted_array.sort_by(|a, b| b.cmp(a));
    } else {
        sorted_array.sort();
    }

    sorted_array
}

