/// >>> count_up_to(1)
/// Vec::<isize>::new()
/// >>> count_up_to(18)
/// vec![2, 3, 5, 7, 11, 13, 17]
fn count_up_to(n: isize) -> Vec<isize> {
    let mut primes = Vec::new();

    if n < 2 {
        return primes;
    }

    primes.push(2);

    for i in 3..n {
        let mut is_prime = true;
        for p in &primes {
            if i % p == 0 {
                is_prime = false;
                break;
            }
        }
        if is_prime {
            primes.push(i);
        }
    }

    primes
}

