/// >>> by_length(vec![1, -1, 55])
/// vec![String::from("One")]
fn by_length(arr: Vec<isize>) -> Vec<String> {
    let mut filtered_arr: Vec<isize> = arr.into_iter().filter(|&x| x >= 1 && x <= 9).collect();
    filtered_arr.sort_unstable();
    filtered_arr.reverse();

    let digit_to_name = |x: isize| match x {
        1 => "One",
        2 => "Two",
        3 => "Three",
        4 => "Four",
        5 => "Five",
        6 => "Six",
        7 => "Seven",
        8 => "Eight",
        9 => "Nine",
        _ => "",
    };

    filtered_arr.into_iter().map(|x| String::from(digit_to_name(x))).collect()
}

