fn eat(number: isize, need: isize, remaining: isize) -> Vec<isize> {
    let mut eaten = number;
    let mut left = remaining;

    if need <= remaining {
        eaten += need;
        left -= need;
    } else {
        eaten += remaining;
        left = 0;
    }

    vec![eaten, left]
}

