/// >>> grade_equation(vec![4.0, 3, 1.7, 2, 3.5])
/// vec![String::from("A+"), String::from("B"), String::from("C-"), String::from("C"), String::from("A-")]
fn numerical_letter_grade(grades: Vec<f64>) -> Vec<String> {
    let mut letter_grades = Vec::new();

    for grade in grades {
        let letter_grade = match grade {
            g if g >= 4.0 => "A+",
            g if g > 3.7 => "A",
            g if g > 3.3 => "A-",
            g if g > 3.0 => "B+",
            g if g > 2.7 => "B",
            g if g > 2.3 => "B-",
            g if g > 2.0 => "C+",
            g if g > 1.7 => "C",
            g if g > 1.3 => "C-",
            g if g > 1.0 => "D+",
            g if g > 0.7 => "D",
            g if g > 0.0 => "D-",
            _ => "E",
        };
        letter_grades.push(String::from(letter_grade));
    }

    letter_grades
}

