/// Given the lengths of the three sides of a triangle. Return the area of
/// the triangle rounded to 2 decimal points if the three sides form a valid triangle. 
/// Otherwise return -1
/// Three sides make a valid triangle when the sum of any two sides is greater 
/// than the third side.
/// Example:
/// >>> triangle_area(3, 4, 5)
/// 6.0
/// >>> triangle_area(1, 2, 10)
/// -1.0
fn triangle_area(a: isize, b: isize, c: isize) -> f64 {
    if a + b > c && a + c > b && b + c > a {
        let s = (a + b + c) as f64 / 2.0;
        let area = (s * (s - a as f64) * (s - b as f64) * (s - c as f64)).sqrt();
        area.round_to(2)
    } else {
        -1.0
    }
}

fn main() {
    println!("{:.2}", triangle_area(3, 4, 5));
    println!("{:.2}", triangle_area(1, 2, 10));
}

trait RoundTo {
    fn round_to(&self, decimal_places: u32) -> f64;
}

impl RoundTo for f64 {
    fn round_to(&self, decimal_places: u32) -> f64 {
        let multiplier = 10f64.powi(decimal_places as i32);
        (self * multiplier).round() / multiplier
    }
}

