/// 1
/// >>> minSubArraySum(vec![-1, -2, -3])
/// -6
fn minSubArraySum(nums: Vec<isize>) -> isize {
    let mut min_sum = nums[0];
    let mut current_sum;

    for i in 0..nums.len() {
        current_sum = 0;
        for j in i..nums.len() {
            current_sum += nums[j];
            min_sum = min_sum.min(current_sum);
        }
    }

    min_sum
}

