/// - The substring after the dot should be one of these: ['txt', 'exe', 'dll']
/// Examples:
/// >>> file_name_check(String::from("example.txt"))
/// String::from("Yes")
/// >>> file_name_check(String::from("1example.dll"))
/// String::from("No")
fn file_name_check(file_name: String) -> String {
    let mut dot_count = 0;
    let mut dot_position = 0;

    for (i, c) in file_name.chars().enumerate() {
        if c == '.' {
            dot_count += 1;
            dot_position = i;
        }
    }

    if dot_count != 1 {
        return String::from("No");
    }

    let parts: Vec<&str> = file_name.split('.').collect();
    let name = parts[0];
    let extension = parts[1];

    if name.is_empty() || !name.chars().next().unwrap().is_alphabetic() {
        return String::from("No");
    }

    let name_digit_count = name.chars().filter(|c| c.is_digit(10)).count();
    if name_digit_count >= 3 {
        return String::from("No");
    }

    match extension {
        "txt" | "exe" | "dll" => String::from("Yes"),
        _ => String::from("No"),
    }
}

