/// Return the largest prime factor of n. Assume n > 1 and is not a prime.
/// >>> largest_prime_factor(13195)
/// 29
/// >>> largest_prime_factor(2048)
/// 2
fn largest_prime_factor(n: isize) -> isize {
    let mut num = n;
    let mut largest_prime = 2;

    while num % 2 == 0 {
        num /= 2;
    }

    for i in (3..=((num as f64).sqrt() as isize)).step_by(2) {
        while num % i == 0 {
            largest_prime = i;
            num /= i;
        }
    }

    if num > 2 {
        largest_prime = num;
    }

    largest_prime
}

