/// Find the shortest palindrome that begins with a supplied string.
/// Algorithm idea is simple:
/// - Find the longest postfix of supplied string that is a palindrome.
/// - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
/// >>> make_palindrome(String::from(""))
/// String::from("")
/// >>> make_palindrome(String::from("cat"))
/// String::from("catac")
/// >>> make_palindrome(String::from("cata"))
/// String::from("catac")
fn make_palindrome(string: String) -> String {
    if string.is_empty() {
        return string;
    }

    let mut longest_palindrome_suffix = String::new();
    for i in 0..=string.len() {
        let suffix = &string[i..];
        if suffix == suffix.chars().rev().collect::<String>() {
            longest_palindrome_suffix = suffix.to_string();
            break;
        }
    }

    let prefix = &string[..string.len() - longest_palindrome_suffix.len()];
    let reversed_prefix = prefix.chars().rev().collect::<String>();

    format!("{}{}", string, reversed_prefix)
}

